import React from "react";


const Counter = () => {
    const state = {
        count: 0,
        tags: ["tag1", "tag2", "tag3"]
    };

    const renderTags = (tags) => {
        tags.length === 0 ? <p>There are no tags!</p> : <ul>{state.tags.map(tag => <li key={tag}>{tag}</li>)}</ul>
    }



    return (
        <>
            {renderTags(state.tags)}
        </>
    )
}


export default Counter;
